/* Home.js */
import React from "react";
import "./Home.scss";

const Home = () => {
  return (
    <div className="cover">
      <div className="row_box">
        <div className="box">
          <img src="https://newsimg.sedaily.com/2024/02/15/2D5DBZTH0H_1.jpg" />
          <h2>웡카</h2>
          <p>별점 4.5</p>
        </div>

        <div className="box">
          <img src="https://image.tmdb.org/t/p/original/wv22frLmCpXDRjKj4MWFwa4eTOK.jpg" />
          <h2>듄2</h2>
          <p>별점 4.0</p>
        </div>
        <div className="box">
          <img src="https://image.tmdb.org/t/p/w600_and_h900_bestv2/hu4nI6znjpdLqcq2SLfLRc3CJOQ.jpg" />
          <h2>시민덕희</h2>
          <p>별점 3.0</p>
        </div>
        <br />
        <div className="box">
          <img src="https://image.tmdb.org/t/p/w600_and_h900_bestv2/hu4nI6znjpdLqcq2SLfLRc3CJOQ.jpg" />
          <h2>시민덕희</h2>
          <p>별점 3.0</p>
        </div>
      </div>
    </div>
  );
};

export default Home;
